(1, 1, '2022-02-03 23:10:49', '2022-02-03 23:10:49', '<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2022-02-03 23:10:49', '2022-02-03 23:10:49', '', 0, 'http://localhost/?p=1', 0, 'post', '', 1),
(2, 1, '2022-02-03 23:10:49', '2022-02-03 23:10:49', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2022-02-03 23:10:49', '2022-02-03 23:10:49', '', 0, 'http://localhost/?page_id=2', 0, 'page', '', 0),
(3, 1, '2022-02-03 23:10:49', '2022-02-03 23:10:49', '<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->', 'Privacy Policy', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2022-02-03 23:10:49', '2022-02-03 23:10:49', '', 0, 'http://localhost/?page_id=3', 0, 'page', '', 0),
(5, 1, '2022-02-04 15:50:56', '2022-02-04 15:50:56', '<!-- wp:paragraph -->\n<p>[e2scala-working-groups]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Working Groups', '', 'publish', 'closed', 'closed', '', 'working-groups', '', '', '2022-04-19 15:49:54', '2022-04-19 15:49:54', '', 0, 'http://localhost/?page_id=5', 0, 'page', '', 0),
(7, 1, '2022-02-04 15:50:56', '2022-02-04 15:50:56', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Resources to help educated you on geotechnical aspects of earthquake engineering, from the assessment of seismic hazards, to the prediction of the response of soils and foundation systems to seismic loading.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br><br>\n<!-- /wp:html -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<a href=\"http://localhost/recorded-interviews-2/\" style=\"font-size: 25px; color: #1D668D; font-weight: bold\" >Recorded Interviews</a>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Recorded interviews that will help your prepare for your own.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<a href=\"http://localhost/e2scala-workbench-2/\" style=\"font-size: 25px; color: #1D668D; font-weight: bold\" >E<sup>2</sup>SCALA Workbench</a>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Lists of hyperlinks and Jupyter Workflows.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<a href=\"http://localhost/training/\" style=\"font-size: 25px; color: #1D668D; font-weight: bold\" >Training Modules</a>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Workshops and lectures on various topics.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<a href=\"http://localhost/webinars/\" style=\"font-size: 25px; color: #1D668D; font-weight: bold\" >Webinars</a>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\">Live and previously recorded webinars.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Resources', '', 'publish', 'closed', 'closed', '', 'resources', '', '', '2022-04-27 19:15:14', '2022-04-27 19:15:14', '', 0, 'http://localhost/?page_id=7', 0, 'page', '', 0),
(8, 1, '2022-03-21 14:39:02', '2022-03-21 14:39:02', '<!-- wp:tribe/events-list -->\n<!-- wp:legacy-widget {\"idBase\":\"tribe-widget-events-list\",\"instance\":{\"encoded\":\"YTo2OntzOjU6InRpdGxlIjtzOjE1OiJVcGNvbWluZyBFdmVudHMiO3M6NToibGltaXQiO3M6MToiNSI7czoxODoibm9fdXBjb21pbmdfZXZlbnRzIjtiOjA7czoyMDoiZmVhdHVyZWRfZXZlbnRzX29ubHkiO2I6MDtzOjEzOiJqc29ubGRfZW5hYmxlIjtiOjE7czoyMDoidHJpYmVfaXNfbGlzdF93aWRnZXQiO2I6MDt9\",\"hash\":\"698f96bce5c1b7fed08e7e3b426eb30f\"}} /-->\n<!-- /wp:tribe/events-list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Events', '', 'publish', 'closed', 'closed', '', 'events', '', '', '2022-04-05 20:38:57', '2022-04-05 20:38:57', '', 0, 'http://localhost/?page_id=8', 0, 'page', '', 0),
(9, 1, '2022-02-04 15:50:56', '2022-02-04 15:50:56', '<!-- wp:image {\"align\":\"center\",\"id\":122,\"width\":586,\"height\":322,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"http://localhost/wp-content/uploads/2022/02/Full_Logo_Rockclimbing-1024x562.png\" alt=\"\" class=\"wp-image-122\" width=\"586\" height=\"322\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>E<sup>2</sup>SCALA is a web-based application for the Earthquake Engineering and Seismology Community Alliance in Latin America. E<sup>2</sup>SCALA comes from the Spanish word \"escala\" which means to \"climb\" or to \"scale\" and those words are key drivers of this project; to help Latin American students reach their highest potential (to climb), while building a network that grows with the community’s goals (to scale up). The E<sup>2</sup>SCALA initiative will provide global, open access to educational resources, virtual mentorship, and collaboration opportunities to Latin American students in the US and at partner academic institutions in Latin America.</p>\n<!-- /wp:paragraph -->', 'About E<sup>2</sup>SCALA', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2022-02-23 14:42:00', '2022-02-23 14:42:00', '', 0, 'http://localhost/?page_id=9', 0, 'page', '', 0),
