(43, 1, '2022-02-07 15:40:45', '2022-02-07 15:40:45', '<!-- wp:paragraph -->\n<p>E<sup>2</sup>SCALA is a web-based application for the Earthquake Engineering and Seismology Community Alliance in Latin America. E<sup>2</sup>SCALA comes from the Spanish word \"escala\" which means to \"climb\" or to \"scale\" and those words are key drivers of this project; to help Latin American students reach their highest potential (to climb), while building a network that grows with the community’s goals (to scale up). The E<sup>2</sup>SCALA initiative will provide global, open access to educational resources, virtual mentorship, and collaboration opportunities to Latin American students in the US and at partner academic institutions in Latin America.</p>\n<!-- /wp:paragraph -->', 'About', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2022-02-07 15:40:45', '2022-02-07 15:40:45', '', 9, 'http://localhost/?p=43', 0, 'revision', '', 0),
