(46, 1, '2022-02-07 15:48:56', '2022-02-07 15:48:56', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<br><br><br>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"larger\"} -->\n<h2 class=\"has-text-align-center has-larger-font-size\">Join The E<sup>2</sup>SCALA Community Today!</h2>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"small\"} -->\n<p class=\"has-text-align-center has-small-font-size\">E<sup>2</sup>SCALA is a web-based application for the Earthquake Engineering and Seismology Community Alliance in Latin America. E<sup>2</sup>SCALA comes from the Spanish word “escala” which means to “climb” or to “scale” and those words are key drivers of this project; to help Latin American students reach their highest potential (to climb), while building a network that grows with the community’s goals (to scale up). The E<sup>2</sup>SCALA initiative will provide global, open access to educational resources, virtual mentorship, and collaboration opportunities to Latin American students in the US and at partner academic institutions in Latin America.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"small\"} -->\n<p class=\"has-text-align-center has-small-font-size\"><strong>Click below to join other like-minded professionals and students!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"backgroundColor\":\"theme-secondary\"} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-theme-secondary-background-color has-background\" href=\"http://localhost/my-account/\">Join Now</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<br><br><br><br><br><br><br><br><br>\n<!-- /wp:html -->\n\n<!-- wp:image {\"id\":882,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost/wp-content/uploads/2022/04/E2SCALA_Logo-4.gif\" alt=\"\" class=\"wp-image-882\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'E<sup>2</sup>SCALA', '', 'publish', 'closed', 'closed', '', 'e2scala', '', '', '2022-04-27 19:40:37', '2022-04-27 19:40:37', '', 0, 'http://localhost/?page_id=46', 0, 'page', '', 0),
