(297, 1, '2022-02-07 15:48:56', '2022-02-07 15:48:56', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"larger\"} -->\n<h2 class=\"has-text-align-center has-larger-font-size\">¡Únase a la Comunidad E<sup>2</sup>SCALA hoy!</h2>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"small\"} -->\n<p class=\"has-text-align-center has-small-font-size\">E<sup>2</sup>SCALA es una aplicación web para la Alianza Comunitaria de Ingeniería Sísmica y Sismología en América Latina. E<sup>2</sup>SCALA proviene de la palabra española \"escala\" que significa \"escalar\" y esas palabras son los impulsores clave de este proyecto; para ayudar a los estudiantes latinoamericanos a alcanzar su máximo potencial (para escalar), mientras construyen una red que crece con los objetivos de la comunidad (para escalar). La iniciativa E2SCALA brindará acceso abierto y global a recursos educativos, tutoría virtual y oportunidades de colaboración para estudiantes latinoamericanos en los EE. UU. y en instituciones académicas asociadas en América Latina.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"small\"} -->\n<p class=\"has-text-align-center has-small-font-size\"><strong>¡Haga clic a continuación para unirse a otros profesionales y estudiantes de ideas afines!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"backgroundColor\":\"theme-secondary\"} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-theme-secondary-background-color has-background\" href=\"http://localhost/mi-cuenta/\">Únete Ahora</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<br><br><br><br><br><br>\n<!-- /wp:html -->\n\n<!-- wp:image {\"id\":886,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost/wp-content/uploads/2022/04/E2SCALA_Logo-5.gif\" alt=\"\" class=\"wp-image-886\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'E2SCALA - Español', '', 'publish', 'closed', 'closed', '', 'e2scala-espanol', '', '', '2022-04-22 20:19:06', '2022-04-22 20:19:06', '', 0, 'http://localhost/e2scala-espanol/', 0, 'page', '', 0),
