(330, 1, '2022-03-21 14:00:54', '2022-03-21 14:00:54', '<!-- wp:paragraph -->\n<p id=\"tw-target-text\">E2SCALA es una aplicación web para la Alianza Comunitaria de Ingeniería Sísmica y Sismología en América Latina. E2SCALA proviene de la palabra española \"escala\" que significa \"escalar\" o \"escalar\" y esas palabras son los impulsores clave de este proyecto; para ayudar a los estudiantes latinoamericanos a alcanzar su máximo potencial (para escalar), mientras construyen una red que crece con los objetivos de la comunidad (para escalar). La iniciativa E2SCALA brindará acceso abierto y global a recursos educativos, tutoría virtual y oportunidades de colaboración para estudiantes latinoamericanos en los EE. UU. y en instituciones académicas asociadas en América Latina.</p>\n<!-- /wp:paragraph -->', 'Acera de E<sup>2</sup>SCALA', '', 'inherit', 'closed', 'closed', '', '329-revision-v1', '', '', '2022-03-21 14:00:54', '2022-03-21 14:00:54', '', 329, 'http://localhost/?p=330', 0, 'revision', '', 0),
