(780, 2, '2022-04-11 14:53:25', '2022-04-11 14:53:25', '<!-- wp:paragraph -->\n<p>The<a href=\"https://cabas.wordpress.ncsu.edu/\"> Geohazards and Earthquake Engineering (GeoQuake) lab</a> is a research lab in the Civil, Construction, and Environmental Engineering Department at NC State. They investigate how soils and rocks increase the damaging potential of earthquakes to civil infrastructure. GeoQuake also strives to advance education and outreach programs for women and Latin American students.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The underrepresentation of Latin American students in STEM programs remains a challenge, and the disproportionate effects of earthquakes in Latin American countries reveal the critical need for community alliances to connect and engage professionals and students in Latin America who have an interest in earthquake engineering and seismology. The Earthquake Engineering Seismology Community Alliance in Latin America, or E<sup>2</sup>SCALA for short, will provide global open access to educational resources, virtual mentorship, and collaboration opportunities to Latin American students in the US and at partner academic institutions in Latin America.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The site is still under development as of now, but it is coming along nicely!</p>\n<!-- /wp:paragraph -->', 'E²SCALA Launch Coming Soon!', '', 'publish', 'closed', 'closed', '', 'e2scala-launch-coming-soon', '', '', '2022-04-27 23:52:31', '2022-04-27 23:52:31', '', 0, 'http://localhost/?post_type=news&#038;p=780', 0, 'news', '', 0),
