(934, 2, '2022-04-27 18:26:49', '2022-04-27 18:26:49', '12NCEE is the upcoming U.S. National Conference on Earthquake Engineering, hosted by the Earthquake Engineering Research Institute (EERI) every 4 years in conjunction with federal and local partners. This milestone conference brings together professionals from the U.S. and international earthquake community, across a broad range of disciplines: architecture, civil and structural engineering, seismology, geology, geophysics, geotechnical engineering, business, public policy, the social sciences, regional planning, emergency response, and regulation. The 2022 EERI Annual Meeting and EERI’s Annual Undergraduate Seismic Design Competition will take place concurrently.', '12th National Conference on Earthquake Engineering', '', 'publish', 'open', 'closed', '', '12th-national-conference-on-earthquake-engineering', '', '', '2022-04-27 18:28:01', '2022-04-27 18:28:01', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=934', 0, 'tribe_events', '', 0),
(935, 2, '2022-04-27 18:26:49', '2022-04-27 18:26:49', '12NCEE is the upcoming U.S. National Conference on Earthquake Engineering, hosted by the Earthquake Engineering Research Institute (EERI) every 4 years in conjunction with federal and local partners. This milestone conference brings together professionals from the U.S. and international earthquake community, across a broad range of disciplines: architecture, civil and structural engineering, seismology, geology, geophysics, geotechnical engineering, business, public policy, the social sciences, regional planning, emergency response, and regulation. The 2022 EERI Annual Meeting and EERI’s Annual Undergraduate Seismic Design Competition will take place concurrently.', '12th National Conference on Earthquake Engineering', '', 'inherit', 'closed', 'closed', '', '934-revision-v1', '', '', '2022-04-27 18:26:49', '2022-04-27 18:26:49', '', 934, 'http://localhost/?p=935', 0, 'revision', '', 0),
(936, 2, '2022-04-27 18:31:25', '2022-04-27 18:31:25', 'Since 1975, the Natural Hazards Center has hosted the Annual Natural Hazards Research and Applications Workshop in Colorado. Today the Workshop brings together federal, state, and local mitigation and emergency management officials and planning professionals; representatives of nonprofit, private sector, and humanitarian organizations; hazards and disaster researchers; and others dedicated to alleviating the impacts of disasters.', '47th Annual Natural Hazards Research and Applications Workshop', '', 'publish', 'open', 'closed', '', '47th-annual-natural-hazards-research-and-applications-workshop', '', '', '2022-04-27 18:31:25', '2022-04-27 18:31:25', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=936', 0, 'tribe_events', '', 0),
(937, 2, '2022-04-27 18:26:49', '2022-04-27 18:26:49', '12NCEE es la próxima Conferencia Nacional de EE. UU. sobre Ingeniería Sísmica, organizada por el Instituto de Investigación de Ingeniería Sísmica (EERI) cada 4 años junto con socios federales y locales. Esta conferencia histórica reúne a profesionales de la comunidad de terremotos de EE. UU. e internacional, en una amplia gama de disciplinas: arquitectura, ingeniería civil y estructural, sismología, geología, geofísica, ingeniería geotécnica, negocios, política pública, ciencias sociales, planificación regional, emergencia respuesta y regulación. La Reunión Anual de EERI de 2022 y la Competencia Anual de Diseño Sísmico para Pregrado de EERI se llevarán a cabo simultáneamente.', 'XII Congreso Nacional de Ingeniería Sísmica', '', 'publish', 'open', 'closed', '', 'xii-congreso-nacional-de-ingenieria-sismica', '', '', '2022-04-27 18:32:56', '2022-04-27 18:32:56', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=937', 0, 'tribe_events', '', 0),
(938, 2, '2022-04-27 18:31:25', '2022-04-27 18:31:25', 'Since 1975, the Natural Hazards Center has hosted the Annual Natural Hazards Research and Applications Workshop in Colorado. Today the Workshop brings together federal, state, and local mitigation and emergency management officials and planning professionals; representatives of nonprofit, private sector, and humanitarian organizations; hazards and disaster researchers; and others dedicated to alleviating the impacts of disasters.', '47th Annual Natural Hazards Research and Applications Workshop', '', 'inherit', 'closed', 'closed', '', '936-revision-v1', '', '', '2022-04-27 18:31:25', '2022-04-27 18:31:25', '', 936, 'http://localhost/?p=938', 0, 'revision', '', 0),
(939, 2, '2022-04-27 18:32:56', '2022-04-27 18:32:56', '12NCEE es la próxima Conferencia Nacional de EE. UU. sobre Ingeniería Sísmica, organizada por el Instituto de Investigación de Ingeniería Sísmica (EERI) cada 4 años junto con socios federales y locales. Esta conferencia histórica reúne a profesionales de la comunidad de terremotos de EE. UU. e internacional, en una amplia gama de disciplinas: arquitectura, ingeniería civil y estructural, sismología, geología, geofísica, ingeniería geotécnica, negocios, política pública, ciencias sociales, planificación regional, emergencia respuesta y regulación. La Reunión Anual de EERI de 2022 y la Competencia Anual de Diseño Sísmico para Pregrado de EERI se llevarán a cabo simultáneamente.', 'XII Congreso Nacional de Ingeniería Sísmica', '', 'inherit', 'closed', 'closed', '', '937-revision-v1', '', '', '2022-04-27 18:32:56', '2022-04-27 18:32:56', '', 937, 'http://localhost/?p=939', 0, 'revision', '', 0),
(940, 2, '2022-04-27 18:35:56', '2022-04-27 18:35:56', 'The 2022 Researchers Meeting will focus on the theme of <a href=\"https://hazards.colorado.edu/workshop/2022/researchers-meeting/overview\">Back to the Field? Hazards and Disaster Research Following the Pandemic</a>. Plenary and thematic sessions will address questions related to how the pandemic has altered approaches to hazards and disaster research, while also considering the potential long-term consequences of COVID-19 on the research enterprise and communities that face disasters. Researchers from all disciplines and all career stages are encouraged to submit abstracts for presentation.', '2022 Researchers Meeting Information', '', 'publish', 'open', 'closed', '', '2022-researchers-meeting-information', '', '', '2022-04-27 18:35:56', '2022-04-27 18:35:56', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=940', 0, 'tribe_events', '', 0),
(941, 2, '2022-04-27 18:31:25', '2022-04-27 18:31:25', 'Desde 1975, el Centro de Riesgos Naturales ha organizado el Taller Anual de Investigación y Aplicaciones de Riesgos Naturales en Colorado. En la actualidad, el Taller reúne a funcionarios y profesionales de planificación de mitigación y manejo de emergencias federales, estatales y locales; representantes de organizaciones sin fines de lucro, del sector privado y humanitarias; investigadores de peligros y desastres; y otros dedicados a paliar los impactos de los desastres. Puede leer más sobre el Taller y su historia en el sitio web del Centro.', '47th Taller Anual de Investigación y Aplicaciones de Riesgos Naturales', '', 'publish', 'open', 'closed', '', '47th-taller-anual-de-investigacion-y-aplicaciones-de-riesgos-naturales', '', '', '2022-04-27 18:37:49', '2022-04-27 18:37:49', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=941', 0, 'tribe_events', '', 0),
