(943, 2, '2022-04-27 18:37:49', '2022-04-27 18:37:49', 'Desde 1975, el Centro de Riesgos Naturales ha organizado el Taller Anual de Investigación y Aplicaciones de Riesgos Naturales en Colorado. En la actualidad, el Taller reúne a funcionarios y profesionales de planificación de mitigación y manejo de emergencias federales, estatales y locales; representantes de organizaciones sin fines de lucro, del sector privado y humanitarias; investigadores de peligros y desastres; y otros dedicados a paliar los impactos de los desastres. Puede leer más sobre el Taller y su historia en el sitio web del Centro.', '47th Taller Anual de Investigación y Aplicaciones de Riesgos Naturales', '', 'inherit', 'closed', 'closed', '', '941-revision-v1', '', '', '2022-04-27 18:37:49', '2022-04-27 18:37:49', '', 941, 'http://localhost/?p=943', 0, 'revision', '', 0),
(944, 2, '2022-04-27 18:40:21', '2022-04-27 18:40:21', '<h2>Call for Abstracts!</h2>\r\n<h3>Special Topics for Geo-Risk 2023:</h3>\r\n<ul>\r\n 	<li>Big Data, Artificial Intelligence, and Machine Learning in Geo-Engineering</li>\r\n 	<li>Reliability and Risk Assessment of Existing Geotechnical Infrastructure</li>\r\n 	<li>Risk and Reliability in Rock Engineering</li>\r\n 	<li>Advances on Probabilistic Methods for Resilient Geotechnical Infrastructure</li>\r\n 	<li>Risk‐Based Approaches in Assessing Geohazards and Extreme Events</li>\r\n 	<li>Modeling Georisk in Construction</li>\r\n 	<li>Integrated Studies for De‐Risking Projects: Geology, Geophysics, Geotechnical and Geomatics</li>\r\n 	<li>State‐of‐Practice in Modeling Spatial Variability</li>\r\n 	<li>Uncertainty Characterization of Geotechnical and Geological Models</li>\r\n 	<li>Best Practices of Risk Assessment and Management in Offshore Projects</li>\r\n 	<li>Advances in Reliability-Based Design and Risk- Based Code Development</li>\r\n 	<li>Practice of Risk Assessment and Management in Geo‐ Engineering</li>\r\n 	<li>Georisk in Climate Change, Sustainability, and Decarbonization</li>\r\n 	<li>Georisk in Engineering Education</li>\r\n</ul>\r\n<h3>Abstracts are due May 20, 2022 at 11:59 PM EST</h3>', 'Geo-Risk 2023', '', 'publish', 'open', 'closed', '', 'geo-risk-2023', '', '', '2022-04-27 18:40:21', '2022-04-27 18:40:21', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=944', 0, 'tribe_events', '', 0),
(945, 2, '2022-04-27 18:40:21', '2022-04-27 18:40:21', '<h2>Call for Abstracts!</h2>\r\n<h3>Special Topics for Geo-Risk 2023:</h3>\r\n<ul>\r\n 	<li>Big Data, Artificial Intelligence, and Machine Learning in Geo-Engineering</li>\r\n 	<li>Reliability and Risk Assessment of Existing Geotechnical Infrastructure</li>\r\n 	<li>Risk and Reliability in Rock Engineering</li>\r\n 	<li>Advances on Probabilistic Methods for Resilient Geotechnical Infrastructure</li>\r\n 	<li>Risk‐Based Approaches in Assessing Geohazards and Extreme Events</li>\r\n 	<li>Modeling Georisk in Construction</li>\r\n 	<li>Integrated Studies for De‐Risking Projects: Geology, Geophysics, Geotechnical and Geomatics</li>\r\n 	<li>State‐of‐Practice in Modeling Spatial Variability</li>\r\n 	<li>Uncertainty Characterization of Geotechnical and Geological Models</li>\r\n 	<li>Best Practices of Risk Assessment and Management in Offshore Projects</li>\r\n 	<li>Advances in Reliability-Based Design and Risk- Based Code Development</li>\r\n 	<li>Practice of Risk Assessment and Management in Geo‐ Engineering</li>\r\n 	<li>Georisk in Climate Change, Sustainability, and Decarbonization</li>\r\n 	<li>Georisk in Engineering Education</li>\r\n</ul>\r\n<h3>Abstracts are due May 20, 2022 at 11:59 PM EST</h3>', 'Geo-Risk 2023', '', 'inherit', 'closed', 'closed', '', '944-revision-v1', '', '', '2022-04-27 18:40:21', '2022-04-27 18:40:21', '', 944, 'http://localhost/?p=945', 0, 'revision', '', 0),
(946, 2, '2022-04-27 18:35:56', '2022-04-27 18:35:56', 'El Encuentro de Investigadores de 2022 se centrará en el tema ¿Regreso al campo? Investigación de peligros y desastres después de la pandemia. Las sesiones plenarias y temáticas abordarán cuestiones relacionadas con la forma en que la pandemia ha alterado los enfoques de la investigación sobre amenazas y desastres, al mismo tiempo que se consideran las posibles consecuencias a largo plazo de la COVID-19 en la empresa de investigación y las comunidades que enfrentan desastres. Se alienta a los investigadores de todas las disciplinas y todas las etapas de la carrera a enviar resúmenes para su presentación.', 'Información Reunión de Investigadores', '', 'publish', 'open', 'closed', '', 'informacion-reunion-de-investigadores', '', '', '2022-04-27 18:41:53', '2022-04-27 18:41:53', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=946', 0, 'tribe_events', '', 0),
(947, 2, '2022-04-27 18:41:53', '2022-04-27 18:41:53', 'El Encuentro de Investigadores de 2022 se centrará en el tema ¿Regreso al campo? Investigación de peligros y desastres después de la pandemia. Las sesiones plenarias y temáticas abordarán cuestiones relacionadas con la forma en que la pandemia ha alterado los enfoques de la investigación sobre amenazas y desastres, al mismo tiempo que se consideran las posibles consecuencias a largo plazo de la COVID-19 en la empresa de investigación y las comunidades que enfrentan desastres. Se alienta a los investigadores de todas las disciplinas y todas las etapas de la carrera a enviar resúmenes para su presentación.', 'Información Reunión de Investigadores', '', 'inherit', 'closed', 'closed', '', '946-revision-v1', '', '', '2022-04-27 18:41:53', '2022-04-27 18:41:53', '', 946, 'http://localhost/?p=947', 0, 'revision', '', 0),
(948, 2, '2022-04-27 18:43:52', '2022-04-27 18:43:52', 'The ES-SSA 2022 Annual Meeting will be hosted by the University of South Florida, Tampa, Florida. The meeting is planned to take place fully in-person and the date is tentatively set for 23-25 October 2022.\r\n\r\nWhile ES-SSA focuses primarily on advancing earthquake science in Central and Eastern North America and intraplate seismology, we also welcome contributions from other aspects of earthquake and seismological studies.', 'ES-SSA 2022 Annual Meeting', '', 'publish', 'open', 'closed', '', 'es-ssa-2022-annual-meeting', '', '', '2022-04-27 18:43:52', '2022-04-27 18:43:52', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=948', 0, 'tribe_events', '', 0),
(949, 2, '2022-04-27 18:43:52', '2022-04-27 18:43:52', 'The ES-SSA 2022 Annual Meeting will be hosted by the University of South Florida, Tampa, Florida. The meeting is planned to take place fully in-person and the date is tentatively set for 23-25 October 2022.\r\n\r\nWhile ES-SSA focuses primarily on advancing earthquake science in Central and Eastern North America and intraplate seismology, we also welcome contributions from other aspects of earthquake and seismological studies.', 'ES-SSA 2022 Annual Meeting', '', 'inherit', 'closed', 'closed', '', '948-revision-v1', '', '', '2022-04-27 18:43:52', '2022-04-27 18:43:52', '', 948, 'http://localhost/?p=949', 0, 'revision', '', 0),
(950, 2, '2022-04-27 18:40:21', '2022-04-27 18:40:21', '<strong>¡Convocatoria de resúmenes!</strong>\r\n\r\n<strong>Temas especiales para Geo-Risk 2023:</strong>\r\n<ul>\r\n 	<li>Big Data, inteligencia artificial y aprendizaje automático en geoingeniería</li>\r\n 	<li>Evaluación de riesgos y confiabilidad de la infraestructura geotécnica existente</li>\r\n 	<li>Riesgo y Confiabilidad en Ingeniería de Rocas</li>\r\n 	<li>Avances en Métodos Probabilísticos para Infraestructura Geotécnica Resiliente</li>\r\n 	<li>Enfoques basados ​​en el riesgo en la evaluación de riesgos geológicos y eventos extremos</li>\r\n 	<li>Modelado de georriesgo en la construcción</li>\r\n 	<li>Estudios Integrados para Proyectos de De‐Risking: Geología, Geofísica, Geotécnica y Geomática</li>\r\n 	<li>Estado de la práctica en el modelado de la variabilidad espacial</li>\r\n 	<li>Incertidumbre Caracterización de Modelos Geotécnicos y Geológicos</li>\r\n 	<li>Mejores Prácticas de Evaluación y Gestión de Riesgos en Proyectos Offshore</li>\r\n 	<li>Avances en diseño basado en confiabilidad y desarrollo de código basado en riesgos</li>\r\n 	<li>Práctica de Evaluación y Gestión de Riesgos en Geoingeniería</li>\r\n 	<li>Georriesgo en Cambio Climático, Sostenibilidad y Descarbonización</li>\r\n 	<li>Georriesgo en la enseñanza de la ingeniería</li>\r\n</ul>\r\n<strong>Los resúmenes deben presentarse el 20 de mayo de 2022 a las 11:59 p. m. EST</strong>', 'Geo-Riesgo 2023', '', 'publish', 'open', 'closed', '', 'geo-riesgo-2023', '', '', '2022-04-27 18:47:02', '2022-04-27 18:47:02', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=950', 0, 'tribe_events', '', 0),
