(953, 2, '2022-04-27 18:43:52', '2022-04-27 18:43:52', 'La Reunión Anual ES-SSA 2022 será organizada por la Universidad del Sur de Florida, Tampa, Florida. Está previsto que la reunión se lleve a cabo totalmente en persona y la fecha está fijada tentativamente para el 23-25 ​​de octubre de 2022.\r\n\r\nSi bien ES-SSA se enfoca principalmente en el avance de la ciencia sísmica en el centro y el este de América del Norte y la sismología intraplaca, también agradecemos las contribuciones de otros aspectos de los estudios sísmicos y sismológicos.', 'Reunión Anual ES-SSA 2022', '', 'publish', 'open', 'closed', '', 'reunion-anual-es-ssa-2022', '', '', '2022-04-27 18:51:09', '2022-04-27 18:51:09', '', 0, 'http://localhost/?post_type=tribe_events&#038;p=953', 0, 'tribe_events', '', 0),
