(970, 2, '2022-04-27 19:20:49', '2022-04-27 19:20:49', '<!-- wp:paragraph -->\n<p>GitHub is an online software development platform used for storing, tracking, and collaborating on software projects. It enables developers to upload their own code files and to collaborate with fellow developers on open-source projects. GitHub also serves as a social networking site in which developers can openly network, collaborate, and pitch their work.</p>\n<!-- /wp:paragraph -->', 'GitHub', '', 'publish', 'closed', 'closed', '', 'github', '', '', '2022-04-27 19:20:58', '2022-04-27 19:20:58', '', 0, 'http://localhost/?post_type=workbench&#038;p=970', 0, 'workbench', '', 0),
(973, 2, '2022-04-27 19:40:29', '2022-04-27 19:40:29', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<br><br><br>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"larger\"} -->\n<h2 class=\"has-text-align-center has-larger-font-size\">Join The E<sup>2</sup>SCALA Community Today!</h2>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"small\"} -->\n<p class=\"has-text-align-center has-small-font-size\">E<sup>2</sup>SCALA is a web-based application for the Earthquake Engineering and Seismology Community Alliance in Latin America. E<sup>2</sup>SCALA comes from the Spanish word “escala” which means to “climb” or to “scale” and those words are key drivers of this project; to help Latin American students reach their highest potential (to climb), while building a network that grows with the community’s goals (to scale up). The E<sup>2</sup>SCALA initiative will provide global, open access to educational resources, virtual mentorship, and collaboration opportunities to Latin American students in the US and at partner academic institutions in Latin America.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"small\"} -->\n<p class=\"has-text-align-center has-small-font-size\"><strong>Click below to join other like-minded professionals and students!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<br>\n<!-- /wp:html -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"center\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"backgroundColor\":\"theme-secondary\"} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-theme-secondary-background-color has-background\" href=\"http://localhost/my-account/\">Join Now</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:html -->\n<br><br><br><br><br><br><br><br><br>\n<!-- /wp:html -->\n\n<!-- wp:image {\"id\":882,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://localhost/wp-content/uploads/2022/04/E2SCALA_Logo-4.gif\" alt=\"\" class=\"wp-image-882\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'E<sup>2</sup>SCALA', '', 'inherit', 'closed', 'closed', '', '46-revision-v1', '', '', '2022-04-27 19:40:29', '2022-04-27 19:40:29', '', 46, 'http://localhost/?p=973', 0, 'revision', '', 0),
(975, 2, '2022-04-11 14:53:25', '2022-04-11 14:53:25', '<!-- wp:paragraph -->\n<p>El laboratorio de Ingeniería de Terremotos y Riesgos Geológicos (GeoQuake) es un laboratorio de investigación en el Departamento de Ingeniería Civil, de Construcción y Ambiental de NC State. Investigan cómo los suelos y las rocas aumentan el potencial dañino de los terremotos para la infraestructura civil. GeoQuake también se esfuerza por promover programas de educación y extensión para mujeres y estudiantes latinoamericanos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La subrepresentación de los estudiantes latinoamericanos en los programas STEM sigue siendo un desafío, y los efectos desproporcionados de los terremotos en los países latinoamericanos revelan la necesidad crítica de alianzas comunitarias para conectar e involucrar a profesionales y estudiantes en América Latina interesados ​​en ingeniería sísmica y sismología. Earthquake Engineering Seismology Community Alliance en América Latina, o E2SCALA para abreviar, brindará acceso abierto global a recursos educativos, tutoría virtual y oportunidades de colaboración para estudiantes latinoamericanos en los EE. UU. y en instituciones académicas asociadas en América Latina.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>El sitio aún está en desarrollo a partir de ahora, ¡pero está funcionando muy bien!</p>\n<!-- /wp:paragraph -->', '¡Lanzamiento de E²SCALA próximamente!', '', 'publish', 'closed', 'closed', '', 'lanzamiento-de-e%c2%b2scala-proximamente', '', '', '2022-04-27 23:57:17', '2022-04-27 23:57:17', '', 0, 'http://localhost/?post_type=news&#038;p=975', 0, 'news', '', 0),
