(27, 'SCALA is a web-based application for the Earthquake Engineering and Seismology Community Alliance in Latin America. E'),
(28, 'SCALA comes from the Spanish word &#8220;escala&#8221; which means to &#8220;climb&#8221; or to &#8220;scale&#8221; and those words are key drivers of this project; to help Latin American students reach their highest potential (to climb), while building a network that grows with the community’s goals (to scale up). The E'),
(29, 'SCALA initiative will provide global, open access to educational resources, virtual mentorship, and collaboration opportunities to Latin American students in the US and at partner academic institutions in Latin America.'),
